import React from 'react'; // we need this to make JSX compile
import CounterDisplay from './CounterDisplay';
import CounterChanger from './CounterChanger';
import './CDE.css';
import jsonObject from '../JSON/CDEContent.json'

interface CDEProps {
  title?: string;
  paragraph?: string;
}

class CDECard extends React.Component<CDEProps> {
    render() {
        const elements = jsonObject.Data.onetype.list1;
        const list = []

        for (var i in elements) {
            list.push(<li>{jsonObject.list1[i]}</li>)
        }

        return (
            <div>
                <section>
                    <h2>CDE Name</h2>
                    <p>{jsonObject.CDE1}</p>

                    <h2> Specification</h2>
                    <p>{jsonObject.spec1}</p>
                    <p className="list">
                        {list}
                    </p>
                    <h2>Collection</h2>
                    <p>{jsonObject.collection1}</p>

                    <h2>Source</h2>
                    <p>{jsonObject.source1}</p>

                    <h2>Definition</h2>
                    <p>{jsonObject.definition1}</p>

                    <div className="counterDisplay">
                    {/* This calls the voting component */}
                    <CounterDisplay /><CounterChanger />
                    </div>
                </section>


            </div>

        )
    };
}

export default CDECard;
